cal values.'=>'یک ورودی محدود شده به مقادیر عددی.','Used to display a message to editors alongside other fields. Useful for providing additional context or instructions around your fields.'=>'','Allows you to specify a link and its properties such as title and target using the WordPress native link picker.'=>'','Uses the native WordPress media picker to upload, or choose images.'=>'از انتخابگر رسانه‌ی بومی وردپرس برای بارگذاری یا انتخاب تصاویر استفاده می‌کند.','Provides a way to structure fields into groups to better organize the data and the edit screen.'=>'','An interactive UI for selecting a location using Google Maps. Requires a Google Maps API key and additional configuration to display correctly.'=>'','Uses the native WordPress media picker to upload, or choose files.'=>'از انتخابگر رسانه‌ی بومی وردپرس برای بارگذاری یا انتخاب پرونده‌ها استفاده می‌کند.','A text input specifically designed for storing email addresses.'=>'یک ورودی متنی که به طور ویژه برای ذخیره‌سازی نشانی‌های رایانامه طراحی شده است.','An interactive UI for picking a date and time. The date return format can be customized using the field settings.'=>'یک رابط کاربری تعاملی برای انتخاب یک تاریخ و زمان. قالب برگرداندن تاریخ می‌تواند به وسیله‌ی تنظیمات فیلد سفارشی‌سازی شود.','An interactive UI for picking a date. The date return format can be customized using the field settings.'=>'یک رابط کاربری تعاملی برای انتخاب یک تاریخ. قالب برگرداندن تاریخ می‌تواند به وسیله‌ی تنظیمات فیلد سفارشی‌سازی شود.','An interactive UI for selecting a color, or specifying a Hex value.'=>'یک رابط کاربری تعاملی برای انتخاب یک رنگ یا مشخص کردن یک مقدار Hex.','A group of checkbox inputs that allow the user to select one, or multiple values that you specify.'=>'یک گروه از ورودی‌های انتخابی که به کاربر اجازه می‌دهد یک یا چند تا از مقادیری که مشخص کرده‌اید را انتخاب کند.','A group of buttons with values that you specify, users can choose one option from the values provided.'=>'یک گروه از دکمه‌ها با مقادیری که مشخص کرده‌اید. کاربران می‌توانند یکی از گزینه‌ها را از مقادیر ارائه شده انتخاب کنند.','Allows you to group and organize custom fields into collapsable panels that are shown while editing content. Useful for keeping large datasets tidy.'=>'','This provides a solution for repeating content such as slides, team members, and call-to-action tiles, by acting as a parent to a set of subfields which can be repeated again and again.'=>'','This provides an interactive interface for managing a collection of attachments. Most settings are similar to the Image field type. Additional settings allow you to specify where new attachments are added in the gallery and the minimum/maximum number of attachments allowed.'=>'','This provides a simple, structured, layout-based editor. The Flexible Content field allows you to define, create and manage content with total control by using layouts and subfields to design the available blocks.'=>'','This allows you to select and display existing fields. It does not duplicate any fields in the database, but loads and displays the selected fields at run-time. The Clone field can either replace itself with the selected fields or display the selected fields as a group of subfields.'=>'','nounClone'=>'تکثیرکردن','PRO'=>'حرفه‌ای','Advanced'=>'پیشرفته','JSON (newer)'=>'JSON (جدیدتر)','Original'=>'اصلی','Invalid post ID.'=>'شناسه پست نامعتبر.','Invalid post type selected for review.'=>'','More'=>'بیشتر','Tutorial'=>'آموزش','Select Field'=>'انتخاب فیلد','Try a different search term or browse %s'=>'واژه‌ی جستجوی متفاوتی را امتحان کنید یا %s را مرور کنید','Popular fields'=>'فیلدهای پرطرفدار','No search results for \'%s\''=>'نتیجه جستجویی برای \'%s\' نبود','Search fields...'=>'جستجوی فیلدها...','Select Field Type'=>'انتخاب نوع فیلد','Popular'=>'محبوب','Add Taxonomy'=>'افزودن طبقه‌بندی','Create custom taxonomies to classify post type content'=>'طبقه‌بندی‌های سفارشی ایجاد کنید تا محتوای نوع نوشته را رده‌بندی کنید','Add Your First Taxonomy'=>'اولین طبقه‌بندی خود را اضافه کنید',