ngine','Advanced Custom Fields and Advanced Custom Fields PRO should not be active at the same time. We\'ve automatically deactivated Advanced Custom Fields PRO.'=>'افزونه فیلدهای سفارشی پیشرفته و افزونه فیلدهای سفارشی پیشرفته‌ی حرفه‌ای نباید همزمان فعال باشند. ما به طور خودکار افزونه فیلدهای سفارشی پیشرفته را غیرفعال کردیم.','Advanced Custom Fields and Advanced Custom Fields PRO should not be active at the same time. We\'ve automatically deactivated Advanced Custom Fields.'=>'افزونه فیلدهای سفارشی پیشرفته و افزونه فیلدهای سفارشی پیشرفته‌ی حرفه‌ای نباید همزمان فعال باشند. ما به طور خودکار فیلدهای سفارشی پیشرفته را غیرفعال کردیم.','<strong>%1$s</strong> - We\'ve detected one or more calls to retrieve ACF field values before ACF has been initialized. This is not supported and can result in malformed or missing data. <a href="%2$s" target="_blank">Learn how to fix this</a>.'=>'<strong>%1$s</strong> - قبل از شروع اولیه ACF، یک یا چند تماس را برای بازیابی مقادیر فیلد ACF شناسایی کرده‌ایم. این مورد پشتیبانی نمی‌شود و می‌تواند منجر به داده‌های ناقص یا از دست رفته شود. <a href="%2$s" target="_blank">با نحوه رفع این مشکل آشنا شوید</a>.','%1$s must have a user with the %2$s role.'=>'','%1$s must have a valid user ID.'=>'%1$s باید یک شناسه کاربری معتبر داشته باشد.','Invalid request.'=>'درخواست نامعتبر.','%1$s is not one of %2$s'=>'%1$s یکی از %2$s نیست','%1$s must have term %2$s.'=>'','%1$s must be of post type %2$s.'=>'','%1$s must have a valid post ID.'=>'%1$s باید یک شناسه نوشته معتبر داشته باشد.','%s requires a valid attachment ID.'=>'%s به یک شناسه پیوست معتبر نیاز دارد.','Show in REST API'=>'نمایش در REST API','Enable Transparency'=>'فعال کردن شفافیت','RGBA Array'=>'آرایه RGBA ','RGBA String'=>'رشته RGBA ','Hex String'=>'کد هگز RGBA ','Upgrade to PRO'=>'‫ارتقا به نسخه حرفه ای','post statusActive'=>'فعال','\'%s\' is not a valid email address'=>'نشانی ایمیل %s معتبر نیست','Color value'=>'مقدار رنگ','Select default color'=>'انتخاب رنگ پیش‌فرض','Clear color'=>'پاک کردن رنگ'